var reqParams = request_parameters;
var order = reqParams.orderBy;
var query = [];
var sortby;
var sortorder;
var request_vendor_parameters = {};

if(order !== null && order !== undefined) {
	query = order.split(" ");
	sortby = query[0];
	sortorder = query[1];

	if(sortorder === "desc") {
		sortorder = "descending"
	} else if (sortorder === "asc") {
		sortorder = "ascending"
	} else {
		sortorder = "ascending"
	}

	request_vendor_parameters['order'] = sortby;
	request_vendor_parameters['order_direction'] = sortorder;
	done({
		"request_vendor_parameters": request_vendor_parameters
	});
} else {
	done({
		"continue": true
	});
}

